  ["meet"] = "<html><body><h1>meet</h1><p>n. a meeting at which a number of athletic contests are held<p></p>v. come together<p></p>v. get together socially or for a specific purpose<p></p>v. fill or meet a want or need</p><p>n. 会, 集会<p></p>a. 适宜的, 合适的<p></p>vt. 遇见, 引见, 认识, 满足, 对付<p></p>vi. 相遇, 接触</p></body></html>",
  ["meeter"] = "<html><body><h1>meeter</h1><p>n. One who meets.</p><p>n. 迎面来的船</p></body></html>",
  ["meeters"] = "<html><body><h1>meeters</h1><p>meeter<p></p>n.<p></p>meet1的变形<p></p>meet1<p></p>[mi:t]<p></p>vt.<p></p>遇见；遇到；与…迎面相逢：<p></p>I met an old school friend today.<p></p>今天我遇到了一位老校友。<p></p>I had never met a foreigner who spoke such perfect English.<p></p>我从未遇到过英语说得如此好的外国人。<p></p>迎接；出迎：<p></p>I'll meet you off the train.<p></p>我会去火车站接你。<p></p>I met her plane.<p></p>我到机场接她。<p></p>碰到；触及；与…接触：<p></p>The two cars met head-on.<p></p>这两辆汽车迎面相撞。<p></p>The vertical line meets the horizontal one here.<p></p>垂直线与水平线在此相交。<p></p>与…会合；(约定地点或时间)和…会面：<p></p>They continue to meet daily.<p></p>他们继续每天相会。<p></p>I'll meet you at the hotel.<p></p>我将在旅馆和你会面<p></p>(经介绍)和…见面；与…相识；结识：<p></p>I know of her but I have never met her.<p></p>我知道她但和她不相识。<p></p>Goar, meet Mr Gollong.<p></p>戈尔，这是戈隆先生。<p></p>与(某人目光)相遇；正视：<p></p>He could not meet his father's eye.<p></p>他不敢正视父亲的目光。<p></p>I could't meet his eyes.<p></p>我不能接触他的目光。<p></p>(河、路等)和…连接；和…汇合；和…交叉：<p></p>Turn right where the highway meets the dirt road.<p></p>在公路和土路交叉的地方向右拐弯。<p></p>和…会谈：<p></p>They are ready to meet the official mediator.<p></p>他们准备和官方调解人会谈。<p></p>与…对抗；与…交手；和…比赛：<p></p>These boxers last met in the world title match last year.<p></p>这些拳击手上一次交手是在去年的世界锦标赛上。<p></p>被(眼睛、耳朵、鼻子等器官)感觉到；(景象等)出现在…面前：<p></p>A terrible sight met her eyes as she entered the room.<p></p>她走进房间时看到一个可怕的景象。<p></p>A pungent odour met their nostrils.<p></p>他们闻到一种刺鼻的气味。<p></p>同意；满足(需求)；达到(目标)：<p></p>Will there be sufficient stocks to meet our demand?<p></p>有足够的存货满足我们的需求吗?<p></p>应付；对付；驳倒；反对：<p></p>They met force by force.<p></p>他们以暴力对付暴力。<p></p>She met his criticism with indifference.<p></p>她以无动于衷的态度对待他的批评。<p></p>支付；偿付：<p></p>His father could not meet his bills.<p></p>他父亲无力偿还欠账。<p></p>He met his debts.<p></p>他偿付了债务。<p></p>和…意见一致；符合(标准)：<p></p>She didn't meet the qualifications for membership.<p></p>她不符合入会条件。<p></p>遭到；遭受；经历：<p></p>She met her death in a road accident.<p></p>她在一次交通事故中丧生。<p></p>vi.<p></p>相会；相遇：<p></p>They met at the party.<p></p>他们在聚会上相遇。<p></p>They met at the station.<p></p>他们在车站相遇。<p></p>接触；相撞：<p></p>We haven't met for 10 years.<p></p>我们有10年未见面了。<p></p>开会；集合；聚会：<p></p>The cabinet meets regularly.<p></p>内阁定期开会。<p></p>They met to hear the speech.<p></p>他们集合听演讲。<p></p>相识；结识；认识：<p></p>He believes they met.<p></p>他确信他们认识。<p></p>(河流、路)互相连接，会合，相交：<p></p>The two roads meet north of Goodman.<p></p>这两条路在古德曼以北相交。<p></p>(多种品质)并存：<p></p>Many virtues meet in the old man.<p></p>这位老人具备多种美德。<p></p>比赛；交手；交战：<p></p>France and Spain will meet in the soccer cup final.<p></p>法国队和西班牙队将在足球锦标赛决赛中交锋。<p></p>意见相互一致<p></p>n.<p></p>会；集会；运动会<p></p>与会者；集会的人；会众<p></p>会场<p></p>(狩猎前猎人和猎犬的)集合<p></p>[美国英语](相向而行的两列火车的)交会点<p></p>【数学】交集<p></p>[美国俚语]爵士乐即兴演奏会<p></p>[俚语](非法交易的)约会，碰头；碰头地点<p></p>短语:<p></p>make (both) ends meet<p></p>见 end¹<p></p>meet someone halfway<p></p>在半路上迎接某人<p></p>迁就某人，对某人做出让步，和某人妥协<p></p>过早担忧某事<p></p>Well met!<p></p>[古语]幸会!幸会!(对久想见到的人的招呼语)<p></p>变形：<p></p>vt.<p></p>met<p></p>. meeting</p></body></html>",
